import profileImage from "../../assets/images/profile-image.jpg";

const Home = () => {
  return (
    <div>
      <h1>
        <span>Hi!</span> I'm Barış
      </h1>
      <p>a Web Devoloper</p>
      <img src={profileImage} />
    </div>
  );
};

export default Home;
